import React from 'react';
import ReactDOM from 'react-dom';

import 'bootstrap/dist/css/bootstrap.min.css';
import 'font-awesome/css/font-awesome.min.css';
import '@fortawesome/fontawesome-free/css/all.css'
import './index.css';
import 'react-bootstrap/dist/react-bootstrap.min.js'

import fullcalendar from 'fullcalendar/dist/fullcalendar.min.css';
import fullcalendarscheduler from 'fullcalendar-scheduler/dist/scheduler.min.css'
import fullcalendarlocale from 'fullcalendar-scheduler/node_modules/fullcalendar/dist/locale/es.js';

import App from './App';
import * as serviceWorker from './serviceWorker';
import { BrowserRouter as Router } from 'react-router-dom';
import { AuthStore } from './contexts/AuthStore';

ReactDOM.render(
  <Router>
    <AuthStore>
      <App />
    </AuthStore>
  </Router>,
  document.getElementById('root'));


serviceWorker.unregister();
